import React from 'react';
import styled from 'styled-components';

// Our single Styled Component definition
const Appbar = styled.App`
  display: flex;
  align-items: center;
  justify-content: center;
  position: fixed;
  width: 10%;
  height: 10%;
  font-size: 40px;
  background: linear-gradient(20deg, rgb(119, 102, 167), #daa357);
`;
const AppContainer = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  position: fixed;
  width: 100%;
  height: 100%;
  font-size: 40px;
  background: linear-gradient(20deg, rgb(219, 112, 147), #daa357);
`;

const App = () => <AppContainer><Appbar>Save</Appbar></AppContainer>;

export default App;
